    url: "biotope"
}]


const mapNav = () => {
    let map = tourSection.map((el,i)=> {
        return ( 
            <div>
            <NavLink to = {el.section}> {el.section} </NavLink>
            </div>

        )
    })
    return map

}


export function Tour() {





    return (
       mapNav()
    )
}

const exported = { Tour };
export default exported;
